import React from "react";
import Contacts from "./Contacts/Contacts";

const PersonalArea = ({contacts}) => {
    return (
        <div>
            {contacts.map(i => <Contacts key = {i.id} name = {i.name} status = {i.status}/>)}
        </div>
    )
}

export default PersonalArea
